import React, { useState } from 'react';
import './App.css';
import SetReminder from '../SetReminder/SetReminder.js';
import RemindersList from '../RemindersList/RemindersList.js';


function App(props) {
  const [state, setState] = useState({
    reminders: [{
      name: 'Justin Albert',
      email: "jnalbert879@gmail.com",
      date: '2020/7/19',
      time: '13:35',
      title: "reminder",
      message: "this is a test is should work"},

    ]
  });



  return (
    <div>
      <h1 className="heading">Remind YourSelf</h1>
      <div className="App">
        <div className="SetReminder">
          <SetReminder name={state} />

        </div>
        <div className="RemindersList">
          <RemindersList />
        </div>
      </div>

    </div>
  );
}


export default App;
